function missedInBackup(prodData, dbData) {
  const res = [];

  for (let backValue of prodData) {
    const foundObject = dbData.find(val => (val.projectName1===backValue.projectName1) && val.projectName2===backValue.projectName2);
    if (!foundObject) {
      res.push(backValue);
    }
  }

  return res;
}

function missedInDB(prodData, dbData) {
  const res = [];

  for (let dbValue of dbData) {
    const foundObject = prodData.find(val => (val.projectName1===dbValue.projectName1) && val.projectName2===dbValue.projectName2);
    if (!foundObject) {
      res.push(dbValue);
    }
  }

  return res;
}

function emptyInDBButHasDataInProd(prodData, dbData) {
  const res = [];
  const filtered = dbData.filter((val) => !val.diskLocationId);

  for (let dbValue of filtered) {
    const foundObject = prodData.find(val => (val.projectName1===dbValue.projectName1) && val.projectName2===dbValue.projectName2);
    if (foundObject) {
      res.push({
        id: dbValue.id,
        pkoValue: dbValue.pkoValue,
        brickID: foundObject.brickID,
        lvBrickName: foundObject.brickName,
        diskLocationId: dbValue.diskLocationId
      });
    }
  }

  return res;
}

function wrongInDBPresentInProd(prodData, dbData) {
  const res = [];
  const filtered = dbData.filter((val) => val.diskLocationId);

  for (let dbValue of filtered) {
    const foundObject = prodData.find(val =>
      val.projectName1===dbValue.projectName1 && val.projectName2===dbValue.projectName2
      && val.brickID!==dbValue.diskLocationId);
    if (foundObject) {
      res.push({
        id: dbValue.id,
        pkoValue: dbValue.pkoValue,
        brickID: foundObject.brickID,
        brickName: foundObject.brickName,
        diskLocationId: dbValue.diskLocationId
      });
    }
  }

  return res;
}


